import React from 'react';
import './css/LeftSidebar.css'

class LeftSidebar extends React.Component {
    render() {
        return(
            <div className="leftsidebar-wrapper">
                <i class="bi bi-plus-circle h1"></i>
            </div>
        )
    }
} 

export default LeftSidebar;
